class LinkListNode(object):    def __init__(self, value, next_node=None):        self.value = value        self.nextNode = next_node# Example node# 10 -> 20 -> 30node1 = LinkListNode(10)node2 = LinkListNode(20)node3 = LinkListNode(30)node4 = LinkListNode(40)node5 = LinkListNode(50)node1.nextNode = node2  # node1 -> node2node2.nextNode = node3  # node2 -> node3node3.nextNode = node4  # node3 -> node4node4.nextNode = node5  # node3 -> node4# node1 -> node2 -> node3while True:    print(f"{node1.value} -> ", end='')    if node1.nextNode is None:        print("End")        break    node1 = node1.nextNode